import { Component, ChangeDetectionStrategy } from '@angular/core';

@Component({
	selector: 'app-layout-footer',
	templateUrl: './footer.component.html',
	changeDetection: ChangeDetectionStrategy.OnPush,
})
export class FooterComponent {
	today: number = Date.now();
}
<footer class="bg-green-100">
	<div class="container">
		<a class="font-bold hover:text-green-700 hover:underline" routerLink="/"
			>conduit</a
		>
		<span class="attribution text-black/100">
			&copy; 2023. An interactive learning project from
			<a href="https://thinkster.io">Thinkster</a>. Code licensed under MIT.
		</span>
	</div>
</footer>
